import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../FoodAppMain.css';  // Certifique-se de criar e importar o arquivo CSS


function FoodAppMain() {
  const navigate = useNavigate();
  const userName = localStorage.getItem('userName');  // Recupera o nome do usuário do localStorage

  return (
    <div className="app-container">
      <header className="app-header">
        <img src="/images/curitiba-logo.png" alt="Curitiba Logo" className="logo"/>
        <h1>Bem vindo! {userName}</h1>
      </header>
      <div className="search-box">
        <input type="text" placeholder="Que tipo de informação você busca?" />
      </div>
      <div className="weekdays-container">
      <button className="day-button" onClick={() => navigate('/menu-details')}>2ª Feira</button>
      <button className="day-button" onClick={() => navigate('/menu-details')}>3ª Feira</button>
      <button className="day-button" onClick={() => navigate('/menu-details')}>4ª Feira</button>
      <button className="day-button" onClick={() => navigate('/menu-details')}>5ª Feira</button>
      <button className="day-button" onClick={() => navigate('/menu-details')}>6ª Feira</button>
      <button className="day-button" onClick={() => navigate('/menu-details')}>Final de Semana</button>
      </div>
    </div>
  );
}

export default FoodAppMain;
